char* morganAndString(char* a, char* b) {
    int alen = strlen(a);
    int blen = strlen(b);
    char * str = calloc(1,alen+blen+1);
    int idx = 0;

    while ( alen>0 && blen>0 ) {
        if ( a[0] <= b[0] ) {
            str[idx++] = a[0];
            a++;
            alen--;
        } else {
            str[idx++] = b[0];
            b++;
            blen--;
        }
    }
    if ( alen>0 ) {
        memcpy(str+idx,a,alen);
        str[idx += alen] = '\0';
    } else if ( blen>0 ) {
        memcpy(str+idx,b,blen);
        str[idx += blen] = '\0';
    }

    return str;
}
